package com.web.internship_api.models;

public class SearchStatisticial {
	private String nameStudent;
	private String sex;
	private String className;
	private String year_study;
	private String nameTeacher;
	private String internshipName;
	private int course;
	public SearchStatisticial() {
		super();
		// TODO Auto-generated constructor stub
	}
	public String getNameStudent() {
		return nameStudent;
	}
	public void setNameStudent(String nameStudent) {
		this.nameStudent = nameStudent;
	}
	public String getSex() {
		return sex;
	}
	public void setSex(String sex) {
		this.sex = sex;
	}
	public String getClassName() {
		return className;
	}
	public void setClassName(String className) {
		this.className = className;
	}
	public String getYear_study() {
		return year_study;
	}
	public void setYear_study(String year_study) {
		this.year_study = year_study;
	}
	public String getNameTeacher() {
		return nameTeacher;
	}
	public void setNameTeacher(String nameTeacher) {
		this.nameTeacher = nameTeacher;
	}
	public String getInternshipName() {
		return internshipName;
	}
	public void setInternshipName(String internshipName) {
		this.internshipName = internshipName;
	}
	public int getCourse() {
		return course;
	}
	public void setCource(int course) {
		this.course = course;
	}
	
}
